// chartIcons.js
/* eslint-disable */
export const chartTypes = [
    "Line", "Bar", "Pie", "Scatter", "GEO/MAP", "Candlestick", "Radar", "Boxplot",
    "Heatmap", "Graph", "Lines", "Tree", "Treemap", "Sunburst", "Parallel",
    "Sankey", "Funnel", "Gauge", "PictorialBar", "ThemeRiver", "Calendar"
]

export const chartIcons = {
    Line: `<svg viewBox="0 0 24 24"><polyline points="4,16 8,12 12,14 16,8 20,10" stroke="#333" stroke-width="2" fill="none"/></svg>`,
    Bar: `<svg viewBox="0 0 24 24"><rect x="4" y="10" width="2" height="10"/><rect x="9" y="6" width="2" height="14"/><rect x="14" y="2" width="2" height="18"/><rect x="19" y="8" width="2" height="12"/></svg>`,
    Pie: `<svg viewBox="0 0 24 24"><circle cx="12" cy="12" r="10" stroke="#333" stroke-width="2" fill="none"/><path d="M12 2 A10 10 0 0 1 22 12 L12 12 Z" fill="#333"/></svg>`,
    Scatter: `<svg viewBox="0 0 24 24"><circle cx="6" cy="18" r="2"/><circle cx="10" cy="10" r="2"/><circle cx="15" cy="6" r="2"/><circle cx="19" cy="14" r="2"/></svg>`,

